(1, 'Terms & Conditions', '<p><strong>Introduction</strong></p>\r\n\r\n<p>Welcome to the&nbsp;<a href=\"https://www.sareewali.com/\"><strong>Sareewali</strong></a><strong>.</strong>&nbsp;<br />\r\nIn using the service of Sareewali you are deemed to have accepted the terms and conditions listed below-&nbsp;<br />\r\n<br />\r\nAll products/services and information displayed on Sareewali constitute an &quot;invitation to offer&quot;. Your order for purchase constitutes your &quot;offer&quot; which shall be subject to the terms and conditions as listed below. Sareewali reserves the right to accept or reject your offer. If you have supplied us with your valid email address, we will notify you by email as soon as possible to confirm receipt of your order and email you again to confirm details and therefore process the order. Our acceptance of your order will take place upon dispatch of the product(s) ordered. No act or omission of Sareewali prior to the actual dispatch of the product(s) ordered will constitute acceptance of your offer.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Eligibility for Membership</strong></p>\r\n\r\n<p>Use of the Site is available only to persons who can form legally binding contracts under applicable law. Persons who are &quot;incompetent to contract&quot; within the meaning of the Indian Contract Act, 1872 including un-discharged insolvents etc. are not eligible to use the Site. If you are a minor i.e. under the age of 18 years but at least 13 years of age, you may use this Site only under the supervision of a parent or legal guardian who agrees to be bound by these Terms of Use. If your age is below that of 18 years, your parents or legal guardians can transact on behalf of you if they are registered users. You are prohibited from purchasing any material which is for adult consumption, the sale or purchase of which to/by minors are strictly prohibited.&nbsp;<br />\r\n<br />\r\nSareewali reserves the right to terminate your membership and refuse to provide you with access to the Site if Sareewali discovers that you are under the age of 18 years. The Site is not available to persons whose membership has been suspended or terminated by Sareewali for any reason whatsoever. If you are registering as a business entity, you represent that you have the authority to bind the entity to this User Agreement.&nbsp;<br />\r\nExcept where additional terms and conditions are provided which are product specific, these terms and conditions supersede all previous representations, understandings, or agreements and shall prevail notwithstanding any variance with any other terms of any order submitted. By using the services of Sareewali you agree to be bound by the Terms and Conditions.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Account and Registration Obligations</strong></p>\r\n\r\n<p>&quot;Your Information&quot; is defined as any information you provide to us in the registration, buying or listing process, in the feedback area or through any email feature. We will protect Your Information in accordance with our Privacy Policy. If you use the Site, you are responsible for maintaining the confidentiality of Your Account and Password and for restricting access to your computer, and you agree to accept responsibility for all activities that occur under Your Account or Password. Sareewali shall not be liable to any person for any loss or damage which may arise as a result of any failure by you to protect your password or account. If you know or suspect that someone else knows your password, you should notify us. If Sareewali has reason to believe that there is likely to be a breach of security or misuse of the Sareewali Site, we may require you to change your password or we may suspend your account without any liability to Sareewali&nbsp;<br />\r\n<br />\r\nYou also agree to:&nbsp;<br />\r\nProvide true, accurate, current and complete information about yourself in Sareewali &#39;s registration form (such information being the &quot;Registration Data&quot;)&nbsp;<br />\r\nMaintain and promptly update the Registration Data to keep it true, accurate, current and complete. If you provide any information that is untrue, inaccurate, incomplete, or not current or if Sareewali has reasonable grounds to suspect that such information is untrue, inaccurate, not current or not in accordance with the User Agreement, Sareewali has the right to indefinitely suspend or terminate your membership and refuse to provide you with access to the Site.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Pricing Information</strong></p>\r\n\r\n<p>While Sareewali strives to provide accurate product and pricing information, pricing or typographical errors may occur. Sareewali cannot confirm the price of a product until after you order. In the event that a product is listed at an incorrect price or with incorrect information due to an error in pricing or product information, Sareewali shall have the right, at our sole discretion, to refuse or cancel any orders placed for that product, unless the product has already been dispatched. In the event that an item is mis-priced, Sareewali may, at its discretion, either contact you for instructions or cancel your order and notify you of such cancellation. Unless the product ordered by you has been dispatched, your offer will not be deemed accepted and Sareewali will have the right to modify the price of the product and contact you for further instructions using the e-mail address provided by you during the time of registration, or cancel the order and notify you of such cancellation. In the event that Sareewali accepts your order the same shall be debited to your credit card account and duly notified to you by email that the payment has been processed. The payment may be processed prior to Sareewali dispatch of the product that you have ordered. If we have to cancel the order after we have processed the payment, the said amount will be reversed back to your credit card account.&nbsp;<br />\r\n<br />\r\nWe strive to provide you with the best prices. However, sometimes a price online does not match the price in a store. In our effort to be the lowest price provider in your particular geographic region, store pricing may sometimes differ from online prices. Prices and availability are subject to change without notice.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cancellation by Sareewali</strong></p>\r\n\r\n<p>Please note that there may be certain orders that we are unable to accept and must cancel. We reserve the right, at our sole discretion, to refuse or cancel any order for any reason. Some situations that may result in your order being canceled include limitations on quantities available for purchase, inaccuracies or errors in product or pricing information, or problems identified by our credit and fraud avoidance department. We may also require additional verifications or information before accepting any order. We will contact you if all or any portion of your order is canceled or if additional information is required to accept your order. If your order is cancelled after your credit card has been charged, the said amount will be reversed back in your Card Account.</p>\r\n\r\n<p><strong>Credit Card Details</strong></p>\r\n\r\n<p>You agree, understand and confirm that the credit card details provided by you for availing of services on Sareewali will be correct and accurate and you shall not use the credit card which is not lawfully owned by you, i.e. in a credit card transaction, you must use your own credit card. You further agree and undertake to provide the correct and valid credit card details when making payment on Sareewali. Your credit card information never reaches Sareewali, we just get pass, hold or fail message from our payment gateways. The said information will not be utilized and shared by our payment gateways or Sareewali with any of the third parties unless required for fraud verifications or by law, regulation or court order. Sareewali will not be liable for any credit card fraud. The liability for use of a card fraudulently will be on you and the onus to &#39;prove otherwise&#39; shall be exclusively on you.</p>\r\n\r\n<p><strong>Fraudulent /Declined Transactions</strong></p>\r\n\r\n<p>Sareewali reserves the right to recover the cost of goods, collection charges and lawyers fees from persons using the Site fraudulently. Sareewali reserves the right to initiate legal proceedings against such persons for fraudulent use of the Site and any other unlawful acts or acts of omissions in breach of these terms and conditions.&nbsp;<br />\r\n<br />\r\nWe as a merchant shall be under no liability whatsoever in respect of any loss or damage arising directly or indirectly out of the decline of authorization for any Transaction, on Account of the Cardholder having exceeded the preset limit mutually agreed by us with our acquiring bank from time to time.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Electronic Communications</strong></p>\r\n\r\n<p>When you visit the Site or send emails to us, you are communicating with us electronically. You consent to receive communications from us electronically. We will communicate with you by email or by posting notices on the Site. You agree that all agreements, notices, disclosures and other communications that we provide to you electronically satisfy any legal requirement that such communications be in writing.</p>\r\n\r\n<p><strong>Conditions for Customer Support Chat</strong></p>\r\n\r\n<p>Sareewali may suspend Sareewali live support service at any time without notice.&nbsp;<br />\r\nSareewali or its executives are not responsible for any delay caused in attending to or replying to the queries via chat.&nbsp;<br />\r\nAny communication through chat may be stored by Sareewali for Sareewali reference; customer would not have the right to access this information at a later date.&nbsp;<br />\r\nWhile chatting you may not put on any objectionable information i.e. unlawful, threatening, abusive, defamatory, obscene information. The chat room will not be used for selling of any products or advising on business opportunity or any other form of solicitation.&nbsp;<br />\r\nYou may proceed further, and chat with our online customer care executive only if you agree to the above terms and conditions.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>You Agree and Confirm</strong></p>\r\n\r\n<p>That in the event that a non-delivery occurs on account of a mistake by you (i.e. wrong name or address or any other wrong information) any extra cost incurred by Sareewali for redelivery shall be claimed from you.&nbsp;<br />\r\nThat you will use the services provided by Sareewali, its affiliates and contracted companies, for lawful purposes only and comply with all applicable laws and regulations while using the Site and transacting on the Site.&nbsp;<br />\r\nYou will provide authentic and true information in all instances where such information is requested of you. Sareewali reserves the right to confirm and validate the information and other details provided by you at any point of time. If upon confirmation your details are found not to be true (wholly or partly), Sareewali has the right in its sole discretion to reject the registration and debar you from using the Services of Sareewali and / or other affiliated websites without prior intimation whatsoever.&nbsp;<br />\r\nThat you are accessing the services available on this Site and transacting at your sole risk and are using your best and prudent judgment before entering into any transaction through this Site That the address at which delivery of the product ordered by you is to be made will be correct and proper in all respects.&nbsp;<br />\r\nThat before placing an order you will check the product description carefully. By placing an order for a product you agree to be bound by the conditions of sale included in the item&#39;s description.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>You may not use the Site for any of the following purposes:</strong></p>\r\n\r\n<p>Disseminating any unlawful, harassing, libelous, abusive, threatening, harmful, vulgar, obscene, or otherwise objectionable material.&nbsp;<br />\r\nTransmitting material that encourages conduct that constitutes a criminal offence, results in civil liability or otherwise breaches any relevant laws, regulations or code of practice.&nbsp;<br />\r\nGaining unauthorized access to other computer systems.&nbsp;<br />\r\nInterfering with any other person&#39;s use or enjoyment of the Site.&nbsp;<br />\r\nBreaching any applicable laws;&nbsp;<br />\r\nInterfering or disrupting networks or web sites connected to the Site.&nbsp;<br />\r\nMaking, transmitting or storing electronic copies of materials protected by copyright without the permission of the owner.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Modification of Terms &amp; Conditions of Service</strong></p>\r\n\r\n<p>Sareewali may at any time modify the Terms &amp; Conditions of Use of the site without any prior notification to you. You can access the latest version of the User Agreement at any given time on Sareewali. You should regularly review the Terms &amp; Conditions on Sareewali. In the event the modified Terms &amp; Conditions is not acceptable to you, you should discontinue using the service. However, if you continue to use the service you shall be deemed to have agreed to accept and abide by the modified Terms &amp; Conditions of Use of this site.</p>\r\n\r\n<p><strong>Governing Law and Jurisdiction</strong></p>\r\n\r\n<p>This User Agreement shall be construed in accord with the applicable laws of India. The Courts at Jaipur shall have exclusive jurisdiction in any proceedings arising out of this agreement.&nbsp;<br />\r\n<br />\r\nAny dispute or difference either in interpretation or otherwise, of any terms of this User Agreement between the parties hereto, the same shall be referred to an independent arbitrator who will be appointed by Sareewali and his decision shall be final and binding on the parties hereto. The above arbitration shall be in accordance with the Arbitration and Conciliation Act, 1996 as amended time to time. The arbitration shall be held in Jaipur. The High Court of judicature at Jaipur alone shall have the jurisdiction and the Laws of India shall apply.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Reviews, Feedback, Submissions</strong></p>\r\n\r\n<p>All reviews, comments, feedback, postcards, suggestions, ideas, and other submissions disclosed, submitted or offered to Sareewali on or by this Site or otherwise disclosed, submitted or offered in connection with your use of this Site (collectively, the &quot;Comments&quot;) shall be and remain Sareewali property. Such disclosure, submission or offer of any Comments shall constitute an assignment to Sareewali of all worldwide rights, titles and interests in all copyrights and other intellectual properties in the Comments. Thus, Sareewali owns exclusively all such rights, titles and interests and shall not be limited in any way in its use, commercial or otherwise, of any Comments. Sareewali will be entitled to use, reproduce, disclose, modify, adapt, create derivative works from, publish, display and distribute any Comments you submit for any purpose whatsoever, without restriction and without compensating you in any way. Sareewali is and shall be under no obligation (1) to maintain any Comments in confidence; (2) to pay you any compensation for any Comments; or (3) to respond to any Comments. You agree that any Comments submitted by you to the Site will not violate this policy or any right of any third party, including copyright, trademark, privacy or other personal or proprietary right(s), and will not cause injury to any person or entity. You further agree that no Comments submitted by you to the Site will be or contain libelous or otherwise unlawful, threatening, abusive or obscene material, or contain software viruses, political campaigning, commercial solicitation, chain letters, mass mailings or any form of &quot;spam&quot;.&nbsp;<br />\r\n<br />\r\nSareewali does not regularly review posted Comments, but does reserve the right (but not the obligation) to monitor and edit or remove any Comments submitted to the Site. You grant Sareewali the right to use the name that you submit in connection with any Comments. You agree not to use a false email address, impersonate any person or entity, or otherwise mislead as to the origin of any Comments you submit. You are and shall remain solely responsible for the content of any Comments you make and you agree to indemnify Sareewali and its affiliates for all claims resulting from any Comments you submit. Sareewali and its affiliates take no responsibility and assume no liability for any Comments submitted by you or any third party.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Copyright &amp; Trademark</strong></p>\r\n\r\n<p>Sareewali and its suppliers and licensors expressly reserve all intellectual property rights in all text, programs, products, processes, technology, content and other materials, which appear on this Site. Access to this Site does not confer and shall not be considered as conferring upon anyone any license under any of Sareewali or any third party&#39;s intellectual property rights. All rights, including copyright, in this website are owned by or licensed to Sareewali or third party suppliers. Any use of this website or its contents, including copying or storing it or them in whole or part, other than for your own personal, non-commercial use is prohibited without the permission of Sareewali. You can not modify, distribute or re-post anything on this website for any purpose.&nbsp;<br />\r\n<br />\r\nThe Sareewali names and logos and all related product and service and Sareewali slogans are the trademarks or service marks of Sareewali. All other marks are the property of their respective companies. No trademark or service mark license is granted in connection with the materials contained on this Site. Access to this Site does not authorize anyone to use any name, logo or mark in any manner.&nbsp;<br />\r\n<br />\r\nAll materials, including images, text, illustrations, designs, icons, photographs, programs, music clips or downloads, video clips and written and other materials that are part of this Site (collectively, the &quot;Contents&quot;) are intended solely for personal, non-commercial use. You may download or copy the Contents and other downloadable materials displayed on the Site for your personal use only. No right, title or interest in any downloaded materials or software is transferred to you as a result of any such downloading or copying. You may not reproduce (except as noted above), publish, transmit, distribute, display, modify, create derivative works from, sell or participate in any sale of or exploit in any way, in whole or in part, any of the Contents, the Site or any related software. All software used on this Site is the property of Sareewali or its suppliers and protected by Indian and international copyright laws. The Contents and software on this Site may be used only as a shopping resource. Any other use, including the reproduction, modification, distribution, transmission, republication, display, or performance, of the Contents on this Site is strictly prohibited. Unless otherwise noted, all Contents are copyrights, trademarks and/or other intellectual property owned, controlled or licensed by Sareewali ,one of its affiliates or by third parties who have licensed their materials to Sareewali and are protected by Indian and international copyright laws. The compilation (meaning the collection, arrangement, and assembly) of all Contents on this Site is the exclusive property of Sareewali and is also protected by Indian and international copyright laws.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Objectionable Material</strong></p>\r\n\r\n<p>You understand that by using this Site or any services provided on the Site, you may encounter Content that may be deemed by some to be offensive, indecent, or objectionable, which Content may or may not be identified as such. You agree to use the Site and any service at your sole risk and that to the fullest extent permitted under applicable law, Sareewali and its affiliates shall have no liability to you for Content that may be deemed offensive, indecent, or objectionable to you.</p>\r\n\r\n<p><strong>Indemnity</strong></p>\r\n\r\n<p>You agree to defend, indemnify and hold harmless Sareewali, its employees, directors, officers, agents and their successors and assigns from and against any and all claims, liabilities, damages, losses, costs and expenses, including attorney&#39;s fees, caused by or arising out of claims based upon your actions or inactions, which may result in any loss or liability to Sareewali or any third party including but not limited to breach of any warranties, representations or undertakings or in relation to the non-fulfillment of any of your obligations under this User Agreement or arising out of the your violation of any applicable laws, regulations including but not limited to Intellectual Property Rights, payment of statutory dues and taxes, claim of libel, defamation, violation of rights of privacy or publicity, loss of service by other subscribers and infringement of intellectual property or other rights. This clause shall survive the expiry or termination of this User Agreement.</p>\r\n\r\n<p><strong>Termination</strong></p>\r\n\r\n<p>This User Agreement is effective unless and until terminated by either you or Sareewali. You may terminate this User Agreement at any time, provided that you discontinue any further use of this Site. Sareewali may terminate this User Agreement at any time and may do so immediately without notice, and accordingly deny you access to the Site, Such termination will be without any liability to Sareewali. Upon any termination of the User Agreement by either you or Sareewali, you must promptly destroy all materials downloaded or otherwise obtained from this Site, as well as all copies of such materials, whether made under the User Agreement or otherwise. Sareewali &#39;s right to any Comments shall survive any termination of this User Agreement. Any such termination of the User Agreement shall not cancel your obligation to pay for the product already ordered from the Site or affect any liability that may have arisen under the User Agreement.</p>\r\n\r\n<p><strong>Limitation of Liability and Disclaimers</strong></p>\r\n\r\n<p>The Site is provided without any warranties or guarantees and in an &quot;As Is&quot; condition. You must bear the risks associated with the use of the Site.&nbsp;<br />\r\n<br />\r\nThe Site provides content from other Internet sites or resources and while Sareewali tries to ensure that material included on the Site is correct, reputable and of high quality, it cannot accept responsibility if this is not the case. Sareewali will not be responsible for any errors or omissions or for the results obtained from the use of such information or for any technical problems you may experience with the Site. This disclaimer does not apply to any product warranty offered by the manufacturer of the product as specified in the product specifications. This disclaimer constitutes an essential part of this User Agreement. To the fullest extent permitted under applicable law, Sareewali or its suppliers shall not be liable for any indirect, incidental, special, consequential or exemplary damages, including but not limited to, damages for loss of profits, goodwill, use, data or other intangible losses arising out of or in connection with the Site, its services or this User Agreement. Without prejudice to the generality of the section above, the total liability of Sareewali to you for all liabilities arising out of this User Agreement be it in tort or contract is limited to the value of the product ordered by you. Sareewali, its associates and technology partners make no representations or warranties about the accuracy, reliability, completeness, correctness and/or timeliness of any content, information, software, text, graphics, links or communications provided on or through the use of the Site or that the operation of the Site will be error free and/or uninterrupted. Consequently, Sareewali assumes no liability whatsoever for any monetary or other damage suffered by you on account of the delay, failure, interruption, or corruption of any data or other information transmitted in connection with use of the Site; and/or any interruption or errors in the operation of the Site.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Site Security</strong></p>\r\n\r\n<p>You are prohibited from violating or attempting to violate the security of the Site, including, without limitation, (a) accessing data not intended for you or logging onto a server or an account which you are not authorized to access; (b) attempting to probe, scan or test the vulnerability of a system or network or to breach security or authentication measures without proper authorization; (c) attempting to interfere with service to any other user, host or network, including, without limitation, via means of submitting a virus to the Site, overloading, &quot;flooding,&quot; &quot;spamming,&quot; &quot;mailbombing&quot; or &quot;crashing;&quot; (d) sending unsolicited email, including promotions and/or advertising of products or services; or (e) forging any TCP/IP packet header or any part of the header information in any email or newsgroup posting. Violations of system or network security may result in civil or criminal liability. Sareewali will investigate occurrences that may involve such violations and may involve, and cooperate with, law enforcement authorities in prosecuting users who are involved in such violations. You agree not to use any device, software or routine to interfere or attempt to interfere with the proper working of this Site or any activity being conducted on this Site. You agree, further, not to use or attempt to use any engine, software, tool, agent or other device or mechanism (including without limitation browsers, spiders, robots, avatars or intelligent agents) to navigate or search this Site other than the search engine and search agents available from Sareewali on this Site and other than generally available third party web browsers (e.g., Netscape Navigator, Microsoft Explorer).</p>\r\n\r\n<p><strong>Entire Agreement</strong></p>\r\n\r\n<p>If any part of this agreement is determined to be invalid or unenforceable pursuant to applicable law including, but not limited to, the warranty disclaimers and liability limitations set forth above, then the invalid or unenforceable provision will be deemed to be superseded by a valid, enforceable provision that most closely matches the intent of the original provision and the remainder of the agreement shall continue in effect. Unless otherwise specified herein, this agreement constitutes the entire agreement between you and Sareewali with respect to the Sareewali sites/services and it supersedes all prior or contemporaneous communications and proposals, whether electronic, oral or written, between you and Sareewali with respect to the Sareewali sites/services. Sareewali&#39;s failure to act with respect to a breach by you or others does not waive its right to act with respect to subsequent or similar breaches.</p>\r\n', 'term', 1555376243),
(2, 'Privacy & Policy', '<p>This Privacy Policy describes how your personal information is collected, used, and shared when you visit or make a purchase from https://www.sareewali.com/ (the &ldquo;Site&rdquo;).</p>\r\n\r\n<p><br />\r\n<strong>PERSONAL INFORMATION WE COLLECT</strong></p>\r\n\r\n<p>When you visit the Site, we automatically collect certain information about your device, including information about your web browser, IP address, time zone, and some of the cookies that are installed on your device. We may also collect information about you through social media sites you use to access our Site depending the permissions you have given for access to your information.<br />\r\nAdditionally, as you browse the Site, we collect information about the individual web pages or products that you view, what websites or search terms referred you to the Site, and information about how you interact with the Site. We refer to this automatically-collected information as &ldquo;Device Information.&rdquo;</p>\r\n\r\n<p><br />\r\n<strong>COOKIES &amp; OTHER TRACKING TECHNOLOGIES THAT WE USE:</strong></p>\r\n\r\n<p>We and our service providers use cookies, beacons &amp; embedded scripts in connection with the Sites.</p>\r\n\r\n<ul>\r\n	<li>&ldquo;Cookies&rdquo; are data files that are placed on your device or computer and often include an anonymous unique identifier. For more information about cookies, and how to disable cookies, visit&nbsp;<a href=\"http://www.allaboutcookies.org/\" target=\"_blank\">http://www.allaboutcookies.org</a></li>\r\n	<li>&ldquo;Log files&rdquo; track actions occurring on the Site, and collect data including your IP address, browser type, Internet service provider, referring/exit pages, and date/time stamps.</li>\r\n	<li>&ldquo;Web beacons,&rdquo; &ldquo;tags,&rdquo; and &ldquo;pixels&rdquo; are electronic files used to record information about how you browse the Site.</li>\r\n	<li>An &ldquo;Embedded script&rdquo; is programming code that is designed to collect information about your interactions with the Site, such as the links you click on. The code is temporarily downloaded onto your computer or device from our web server or a third-party service provider, is active only while you are connected to the Site, and is deactivated or deleted thereafter.</li>\r\n</ul>\r\n\r\n<p>The above technologies are used in analyzing trends, administering the Sites, services and products, tracking users&rsquo; movements around the Sites and to gather demographic information about our user base as a whole. We may receive reports based on the use of these technologies by these companies on an individual as well as aggregated basis.<br />\r\nWe use cookies to remember users&rsquo; settings, market products and services to users, and for authentication purposes.</p>\r\n\r\n<p><strong>Third-Party Advertising Services:</strong>&nbsp;We partner with third parties that may use technologies such as cookies (and local stored objects as described above) to gather information about your activities on the Sites and elsewhere on the Internet in order to provide you with relevant advertising based upon your browsing activities and interests. This type of advertising is sometimes called interest-based advertising. No personally-identifiable information is collected or used in this process.</p>\r\n\r\n<p><strong>Third-Party Analytics:</strong>&nbsp;We may also use service providers, such as Google Analytics, that may use cookies or other technologies to collect information about your online activities across this and other sites over time for non-advertising purposes such as those described above. To learn more about how Google Analytics collects and processes data and the choices Google may offer to control these activities, you may visit http://www.google.com/intl/en/policies/privacy/partners/.</p>\r\n\r\n<p><strong>Google Analytics:</strong>&nbsp;To help facilitate the delivery of relevant content, we use Google Analytics and have implemented the following Google Advertising Features: Remarketing, Impression Reporting, and Demographics and Interest Reporting. We use Google Analytics cookies and other Google advertising cookies. You can opt out of the Google Analytics Advertising Features we use by indicating your preference using the interest-based opt-out link&nbsp;<a href=\"http://optout.networkadvertising.org/?c=1#!/\" target=\"_blank\">here</a>. Google also provides a complete privacy policy, and instructions on opting out of Google Analytics&nbsp;<a href=\"https://tools.google.com/dlpage/gaoptout/\" target=\"_blank\">here</a>. Note that Google&rsquo;s opt-out mechanism is specific to Google activities and does not affect the activities of other ad networks or analytics providers that we may use.</p>\r\n\r\n<p>Additionally when you make a purchase or attempt to make a purchase through the Site, we collect certain information from you, including your name, billing address, shipping address, payment information (we do not store your credit card information), email address, and phone number. We refer to this information as &ldquo;Order Information.&rdquo;</p>\r\n\r\n<p>When we talk about &ldquo;Personal Information&rdquo; in this Privacy Policy, we are talking both about Device Information and Order Information.</p>\r\n\r\n<p><br />\r\n<strong>HOW DO WE USE YOUR PERSONAL INFORMATION?</strong></p>\r\n\r\n<p>We use the Order Information that we collect generally to fulfill any orders placed through the Site (including processing your payment information, arranging for shipping, and providing you with invoices and/or order confirmations). Additionally, we use personal information to:</p>\r\n\r\n<ul>\r\n	<li>We may also use your Personal Information to improve and personalize your experience with us, and, with your consent where necessary, send you information about us and keep you informed of our other products and services that may be of interest to you.</li>\r\n	<li>Communicate with you &amp; send marketing mailers to which you have consented ;</li>\r\n	<li>Screen our orders for potential risk or fraud;</li>\r\n	<li>When in line with the preferences you have shared with us, provide you with information or advertising relating to our products or services.</li>\r\n	<li>We use passively collected information to monitor and maintain the performance of our Sites, analyze trends, usage and activities in connection with our services, validate users and ensure their technological compatibility with users, and optimise our marketing efforts.</li>\r\n</ul>\r\n\r\n<p>We use the Device Information that we collect to help us screen for potential risk and fraud (in particular, your IP address), and more generally to improve and optimize our Site (for example, by generating analytics about how our customers browse and interact with the Site, and to assess the success of our marketing and advertising campaigns).</p>\r\n\r\n<p><br />\r\n<strong>SHARING YOUR PERSONAL INFORMATION</strong></p>\r\n\r\n<p>We may share your Personal Information with third parties as described in this Privacy Policy or otherwise with your permission. We reserve the right to transfer data, including aggregate and de-identified data derived from Personal Information, for lawful purposes in our discretion.</p>\r\n\r\n<ul>\r\n	<li>We may share Personal Information with affiliated businesses.</li>\r\n	<li>Service Providers. We, like many businesses, sometimes hire other companies (&quot;Service Providers&quot;) to perform certain business-related functions. Examples include mailing information, maintaining databases, and hosting services. When we employ a Service Provider to perform a function of this nature, we provide it with the information that it needs to perform its specific function, which may include Personal Information and other information that you provide to us via a Site. These companies are authorised to use your Personal Information only as necessary to provide these services to us.</li>\r\n	<li>Third Parties for Marketing and Other Purposes. With your prior consent, we may share with selected third party partners for our marketing purposes.</li>\r\n	<li>Legal Requirements.We may also share your Personal Information to comply with applicable laws and regulations, to respond to a subpoena, search warrant or other lawful request for information we receive, or to otherwise protect our rights.</li>\r\n	<li>Business Transfers. As we develop our business, we might sell or buy businesses or assets. In the event of a corporate sale, merger, reorganization, dissolution, total or partial sale of assets in bankruptcy or similar event, Personal Information may be part of the transferred assets, but this will be conducted in compliance with Indian law</li>\r\n	<li>Some of our pages utilize framing techniques to serve content to you from our partners while preserving the look and feel of our Sites. When you interact with content from our partners displayed on our Site, please be aware that you are providing your Personal Information to these third parties and it will be governed by their respective privacy policies.</li>\r\n</ul>\r\n\r\n<p><strong>OUR OPT-OUT POLICY</strong></p>\r\n\r\n<p>As described above, we use your Personal Information to provide you with targeted advertisements or marketing communications we believe may be of interest to you.<br />\r\nFor more information about how targeted advertising works, you can visit the Network Advertising Initiative&rsquo;s (&ldquo;NAI&rdquo;) educational page at http://www.networkadvertising.org/understanding-online-advertising/how-does-it-work.<br />\r\n<br />\r\nYou can opt out of targeted advertising by:</p>\r\n\r\n<ul>\r\n	<li>FACEBOOK -&nbsp;<a href=\"https://www.facebook.com/settings/?tab=ads\" target=\"_blank\">https://www.facebook.com/settings/?tab=ads</a></li>\r\n	<li>GOOGLE -&nbsp;<a href=\"https://www.google.com/settings/ads/anonymous\" target=\"_blank\">https://www.google.com/settings/ads/anonymous</a></li>\r\n	<li>BING -&nbsp;<a href=\"https://advertise.bingads.microsoft.com/en-us/resources/policies/personalized-ads\" target=\"_blank\">https://advertise.bingads.microsoft.com/en-us/resources/policies/personalized-ads</a></li>\r\n</ul>\r\n\r\n<p>Additionally, If you wish to not have this information collected and used for interest-based advertising, you may opt-out by clicking&nbsp;<a href=\"http://preferences-mgr.truste.com/?pid=truste01&amp;aid=preference_manager01&amp;type=public\" target=\"_blank\">here</a>&nbsp;for partners that participate in the TRUSTe opt-out tool (or if located in the European Union click&nbsp;<a href=\"http://www.youronlinechoices.eu/\" target=\"_blank\">here</a>). If you wish to opt-out from this type of advertising for companies that participate in the Network Advertising Initiative, please&nbsp;<a href=\"http://optout.networkadvertising.org/?c=1#!/\" target=\"_blank\">click here</a>. If you wish to opt-out from this type of advertising for companies that participate in the Digital Advertising Alliance (&ldquo;DAA&rdquo;), you can do so&nbsp;<a href=\"http://optout.aboutads.info/?c=2#!/\" target=\"_blank\">here</a>. Please note that this does not opt you out of being served ads.</p>\r\n\r\n<p><strong>Email Marketing:</strong>&nbsp;To stop receiving newsletters or marketing communications from us or to opt out of having your email address shared with third parties, please use the &ldquo;unsubscribe&rdquo; mechanism provided in the communication (such as the &ldquo;unsubscribe&rdquo; link at the bottom of the marketing email) or send an e-mail to <a href=\"https://www.sareewali.com/contact\">contact@sareewali.com</a> along with the information necessary for us to process your request.<br />\r\n<br />\r\n<strong>Service-Related Announcements:</strong>&nbsp;We will also send you service-related email announcements on rare occasions when it is necessary to do so. For instance, if our service is temporarily suspended for maintenance, we might send you an email. You do not have an option to opt out of these emails, which are not promotional in nature.</p>\r\n\r\n<p><br />\r\n<strong>DO NOT TRACK</strong></p>\r\n\r\n<p>Please note that we do not alter our Site&rsquo;s data collection and use practices when we see a Do Not Track signal from your browser.</p>\r\n\r\n<p><br />\r\n<strong>YOUR RIGHTS</strong></p>\r\n\r\n<p>If you are a European resident, you have the right to access personal information we hold about you and to ask that your personal information be corrected, updated, or deleted. If you would like to exercise this right, please contact us through the contact information below.<br />\r\nAdditionally, if you are a European resident we note that we are processing your information in order to fulfill contracts we might have with you (for example if you make an order through the Site), or otherwise to pursue our legitimate business interests listed above. Additionally, please note that your information will be transferred outside of Europe, including to Canada and the United States.</p>\r\n\r\n<p><br />\r\n<strong>DATA RETENTION</strong></p>\r\n\r\n<p>When you place an order through the Site, we will maintain your Order Information for our records unless and until you ask us to delete this information.</p>\r\n\r\n<p><br />\r\n<strong>MINORS</strong></p>\r\n\r\n<p>Visitors under 13 years of age are not permitted to use and/or submit their Personal Information at any Site. We do not knowingly solicit or collect information from visitors under 13 years of age. If you are under 13 years of age, please do not submit any information to us. In the event that we learn that a person under the age of 13 has provided us with personal information, we will delete such personal information. Visitors older than the age of 13, but younger than their country&rsquo;s legal age of majority are permitted to use and/or submit their Personal Information only with parental supervision.</p>\r\n\r\n<p>&nbsp;<br />\r\n<strong>MISCELLANEOUS</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Access to Personally Identifiable Information:</strong>&nbsp;If your personally identifiable information changes, or if you no longer desire our service, you may correct, update or delete it by emailing our Customer Support here(contact@sareewali.com). We will respond to your request to access within 24 to 48 hours. We will retain your information for as long as your account is active or as needed to provide you services. We will retain and use your information as necessary to comply with our legal obligations, resolve disputes, and enforce our agreements.</li>\r\n	<li><strong>Links to Other Sites:</strong>&nbsp;Our website contains links to other sites that are not owned or controlled by Utsav. Please be aware that we, Utsav, is not responsible for the privacy practices of such other sites. We encourage you to be aware when you leave our site and to read the privacy statements of each and every Web site that collects personally identifiable information. This privacy statement applies only to information collected by this Web site.</li>\r\n	<li><strong>Public Forums:</strong>&nbsp;Our Web site offers publicly accessible blogs or community forums. You should be aware that any information you provide in these areas may be read, collected, and used by others who access them. To request removal of your personal information from our blog or community forum, email us. In some cases, we may not be able to remove your personal information, in which case we will let you know if we are unable to do so and why.</li>\r\n	<li><strong>Customer Testimonials and Reviews:</strong>&nbsp;We post customer testimonials and reviews on our web site which may contain personally identifiable information. We do obtain the customer&#39;s consent via email prior to posting the testimonial to post their name along with their testimonial. When a customer chooses to post a review of a product, we ask for a nickname and location. If you would like to request to have your testimonial or review removed from our site you may email us.</li>\r\n	<li><strong>Social Media Widgets.</strong>&nbsp;Our Sites may include social media features, such as the Facebook Like button and widgets such as the share this button or interactive mini-programs that run on our Sites. These features may collect your IP address, which pages you are visiting on our Sites, and may set a cookie to enable the feature to function properly. Social media features and widgets are either hosted by a third party or hosted directly on our Sites. Your interactions with these features are governed by the privacy policy of the company providing them.</li>\r\n</ul>\r\n\r\n<p><strong>CHANGES</strong></p>\r\n\r\n<p>We may update this privacy policy from time to time in order to reflect, for example, changes to our practices or for other operational, legal or regulatory reasons.</p>\r\n\r\n<p><strong>CONTACT US</strong></p>\r\n\r\n<p>For more information about our privacy practices, if you have questions, or if you would like to make a complaint, please contact us by&nbsp;<a href=\"https://www.sareewali.com/contact\" target=\"_blank\">e-mail</a>&nbsp;:- contact@sareewali.com</p>\r\n\r\n<p>Contact Number :- +91 8100 444411 / +91 8100 344411</p>\r\n', 'privacy', 1555375852);
INSERT INTO `saree_cms` (`cms_id`, `title`, `description`, `mode`, `date_added`) VALUES
(3, 'Cancellation & Returns', '<p>At Sareewali, we make every effort to make sure you have the best experience while choosing &nbsp;and trading your favorite Indian Ethnic Outfits. In spite of our best efforts to keep our consumers happy, there are times when you might feel the need to return your product for situation beyond your or our control.&nbsp;<br />\r\nWe have listed below about our Cancellation and Refunds policy so that in case you do decide to cancel your order, or seek refunds, you do not face any problem.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>Pre-Shipment Cancellations</h3>\r\n\r\n<h3><strong>1. Cancelation of order in case you change your mind after ordering</strong></h3>\r\n\r\n<p>You can choose to cancel all Non-Ready to Ship products, only if done within 24 hours of placing it. We will initiate 100% refund of your money and a confirmation of the same will be sent to you via e-mail, though we would have loved to have added a new Ethnic Fashion statement to your wardrobe. Please be apprised that Ready To Ship orders are not eligible for cancellations as they are dispatched within 24 hours of the receipt of order.&nbsp;</p>\r\n\r\n<p><strong>2. Cancelation &nbsp;after 24 hours of ordering</strong></p>\r\n\r\n<p>a) Orders cancelled after 24 hours of confirmation are dealt with on a case-to-case basis by our Customer Care team depending on the extent of processing.&nbsp;</p>\r\n\r\n<p>b) We provide the refund for all such orders in the form of a Store Credit only. This Store Credit is redeemable on our Website within a stipulated period from time of issuance.&nbsp;</p>\r\n\r\n<p>c) Please note that it takes a maximum of 4 business days, post the receipt of your cancellation request, for us to cancel your order, and send you a notification via e-mail.</p>\r\n\r\n<p><strong>3. In case of &nbsp;delay at Sareewali because of &quot;unanticipated circumstances&quot;</strong></p>\r\n\r\n<p>&nbsp;We try our &nbsp;&nbsp;best to reassure that your ordered products are shipped out to you in the stipulated time, but at times there are chances of delay in processing due to unavailability of stock, or other unavoidable circumstances. In such a situation, we will send you a formal communication requesting you to :</p>\r\n\r\n<p>a) Accept a Store Credit of equivalent value which you may use to purchase an alternate Ethnic Fashion Statement</p>\r\n\r\n<p><br />\r\nb) Opt to receive a refund of your money.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;4. But if you are unable to find an alternative Ethnic wear </strong></p>\r\n\r\n<p>we ensure that a complete refund (inclusive of the product cost and shipping charges) is initiated at the earliest without any deductions. We also offer a compensation by way of Store Credit or discount coupon depending upon the order value and delay in communication.</p>\r\n\r\n<p><strong>&nbsp;5</strong>. <strong>If you have missed <strong>&nbsp;adding a vital detail while placing the order.</strong></strong></p>\r\n\r\n<p>&nbsp;Such situations are often encountered when customers forget to :</p>\r\n\r\n<p>a) Update their complete shipping particulars;<br />\r\nb) Update measurement attributes; or<br />\r\nc) Verify or give their consent if required on certain pending notifications within the requested time</p>\r\n\r\n<p>As a policy, we try and reach out to our esteemed customers via their registered e-mail address. In case of non-receipt of any response, we try and give them a call. If we do not get a response in 15 days, we issue a Non-refundable Store Credit against cancellation of the order which the customers can use to place future orders with us. We share an update on the same via email as well.&nbsp;<br />\r\nRemember, we try and keep our customers posted at each and every stage of their order with us and it really helps to have your inputs at the right time.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>Post shipment returns</h3>\r\n\r\n<p><strong>1. Return of ordered items if there&#39;s an issue after receipt of an order</strong></p>\r\n\r\n<p>At Sareewali, We take strict measures to deliver Fashion Items to our customers globally, in the best possible condition but &nbsp;at times there&#39;s always a possibility that</p>\r\n\r\n<p>a) Item(s) may get damaged during transit; or<br />\r\nb) There may be a manufacturing defect which didn&#39;t get noticed during packing; or<br />\r\nc) A wrong item is shipped out to you by mistake.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;2 .You should get back to us within 24 hours </strong></p>\r\n\r\n<p>&nbsp;Please contact us within 24 hours of receiving the order for reporting any complaints with regards to the product received as damaged, found with manufacturing defect, or any other issues.</p>\r\n\r\n<p><strong>3. Returns will&nbsp; be accepted only in case of </strong><strong>manufacturing defect or a wrong item has been shipped</strong></p>\r\n\r\n<p>Kindly be informed that any product purchased from our &lsquo;Sale&rsquo; Section will not be returned under the Returns Policy except if it&#39;s an error on behalf relating to a manufacturing defect or a wrong item has been shipped out to you by mistake.&nbsp;We do not accept any returns if the product is dispatched to us after 7 days of receiving the shipment, so please make sure you report the matter to us, and dispatch the product at the earliest once we accept the return request.&nbsp;</p>\r\n\r\n<p>Kindly do not dispatch the products before receiving a &quot;Return Accepted&quot; Confirmation email from us, we will not be able to entertain such requests.</p>\r\n\r\n<p><strong>4. Steps of returning any item ordered from Sareewali</strong></p>\r\n\r\n<p>&nbsp;<strong>a) - Informing Sareewali</strong></p>\r\n\r\n<p>In case you have any complaints regarding the product you have received, please ensure that you report it to us within 24 hours of receiving the product.&nbsp;</p>\r\n\r\n<p><strong>b) - Confirmation email from Sareewali</strong></p>\r\n\r\n<p>You will receive an acknowledgement e-mail from us on confirming a Return Authorization, within 4 business days. Please do not ship items before you receive this email from us. We will be unable to process any &quot;Items Returned&quot; without the Return Authorization Reference.<br />\r\nPlease note: In case needed, we&#39;d request you for a digital picture of the item for our internal review to be able to process your request.</p>\r\n\r\n<p><strong>c) - Shipping Back the Items</strong></p>\r\n\r\n<p>When Shipping back the items:&nbsp;</p>\r\n\r\n<p>i) &nbsp;As would be advised in our return authorization e-mail, please send the items to us preferably through a reputed, registered courier/airmail service only to avoid any transit related issues .&nbsp;<br />\r\nii) Please try and ensure that you retain all the packaging material alongwith the product. Do not remove tags, stickers, etc. Unless you are sure you want to keep the product. Presence of original tags is a must to process returns.<br />\r\niii) Please do not forget to mark the packaging as &quot;Defective Items for Returns&quot; and &quot;not for sale&quot;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>d) - Item Receipt and Inspection at Sareewali stockroom</strong></p>\r\n\r\n<p>As a policy, our teams shall examine the products on return and identify the defects/variation as indicated by you.</p>\r\n\r\n<p><strong>e) - Proposed solutions post receipt of returned items</strong></p>\r\n\r\n<p>Post inspection of returned item(s), our Customer Care team will propose remedial solutions to you on a case to case basis:</p>\r\n\r\n<p>i) Choosing an alternate Ethnic wear as a replacement of equal value<br />\r\nii) A Store Credit to be used later for shopping on Sareewali<br />\r\niii) A Refund as decided on a case to case basis</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Your options if there was an error by Sareewali?</strong></p>\r\n\r\n<p>We will duly acknowledge the issue and you would always be welcome to decide from proceeding with:</p>\r\n\r\n<p>a. An Item Replacement<br />\r\nb. Issuance of a Store Credit<br />\r\nc. A Refund of order value</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>The value of Refund/Store Credit in case you opt for the same</strong></p>\r\n\r\n<p>&nbsp;100% of the value of the goods including Shipping Costs and Stitching charges (as applicable) will be ensured.</p>\r\n\r\n<p>In any case, the refunds will not exceed the actual amount paid by you.</p>\r\n\r\n<p><strong>Payment of &nbsp;the courier service for Shipping the item back.</strong></p>\r\n\r\n<p>If we end up making an error in spite of best efforts, the extra shipping cost incurred during the return of the product will be refunded. In any other case, the Shipping Charges and other expenses would be borne by the customer .</p>\r\n\r\n<p><strong>Reasons &nbsp;for &nbsp;not providing any of the &nbsp;options </strong></p>\r\n\r\n<p>Sareewali&#39;s Customer Care representative will reach out to you with limited alternatives for below cases:</p>\r\n\r\n<p>a.&nbsp;<em>If you do choose to return the product for any reason apart from an inadvertent mistake from our side.</em><br />\r\nThe refund will be processed in the form of a Store Credit redeemable during your next purchase with Sareewali. In case you had opted for Free Stitching or Free Shipping scheme while ordering the item under question, the Cost of Shipping and Stitching will be deducted from the refund amount.&nbsp;<br />\r\nb.&nbsp;<em>If there was a Delay due to God&rsquo;s or the Government&rsquo;s Intervention</em><br />\r\nThere are times when the delivery of the goods is delayed due to unforeseen circumstances such as natural calamity, public holiday, etc. In such a case Sareewali shall not refund, return or exchange any order on request.<br />\r\nc. In case you realize that you might have made an error while ordering or providing measurements, we would ask you to bear the additional charges of shipping and stitching, and in very rare cases cost of replacement of fabric, if any.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Time taken for Returned Items to reach back to the Sareewali stockroom</strong></p>\r\n\r\n<p>&nbsp;Exact time taken for transit would depend on the nature of the product and your location.</p>\r\n\r\n<p><strong>MORE DETAILS ABOUT REFUNDS</strong></p>\r\n\r\n<p>The Refund will be initiated within 4 (business) days if you choose this option, which will be credited back to you as per your bank/credit card guidelines.</p>\r\n\r\n<h3>Time taken for the refund process</h3>\r\n\r\n<p>Payments and Transfers are dependent on Banks and Local Laws. The Refund will be made through Net Banking .</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Reasons for delay at the Bank/Credit Card companies end</strong></p>\r\n\r\n<p>a) For transactions made using Debit/Credit cards, the time taken for refunds depends solely on the service provider.</p>\r\n\r\n<p>b) For customers transacting via Nationalized Banks, please expect a bit of delay in processing since they tend to have longer lead times.</p>\r\n\r\n<p>c) Please be apprised that Banks send an SMS to customers for credit amount of more than INR 5000 only. In case your refund is less than INR 5000 kindly check your bank or credit card account confirmation receipt of funds.&nbsp;</p>\r\n\r\n<p>d) In case you used a Coupon Code or a Store Credit to place your order, the refund will be made in the same form. No cash refunds can be made in such a case as per governing laws.</p>\r\n\r\n<p><strong>Charges levied by Banks, Credit Cards companies and Local Taxes</strong></p>\r\n\r\n<p><strong>Credit Card Fees:</strong></p>\r\n\r\n<p>Please note that Credit Card refunds involve an admin/credit card commission of 10% of the final order value (5% while accepting and 5% while refunding). This cost will be deducted from the value of the refund.<br />\r\nAn alternate solution is an Sareewali Store Credit, which nullifies the Credit Card Commission charge and therefore makes it possible for us to issue a Store Credit equivalent to the final accepted value of creditable funds.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Bank Transfers:</strong></p>\r\n\r\n<p>For orders placed using Bank Transfers, refunds would be issued only as Store Credits.</p>\r\n\r\n<p><strong>Local Taxes:</strong></p>\r\n\r\n<p>The GST&nbsp;are borne directly by the customer as per local laws, to be paid at the time of delivery as advised by the respective courier partner. We will not refund any such charges, if applicable during order delivery.</p>\r\n\r\n<p>You can reach out to our Customer Care Representatives for a step-by-step clarity on all points above by:</p>\r\n\r\n<p><strong>By Mail</strong></p>\r\n\r\n<p>contact@sareewali.com</p>\r\n\r\n<p>Contact :- +91 8100 444411</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;+91 8100 344411</p>\r\n', 'return', 1550374175),
(4, 'Shipping Policy', '<p><strong>Shipping Policy</strong></p>\r\n\r\n<p>We deliver to all and any postal address around the world. Courier companies do not deliver to P.O.Box address, so we request you to provide full street address with pin code / zip code.</p>\r\n\r\n<p>Please note that residential shipments will be left at door if someone is not there to receive the package or no one answers the doorbell. Our courier agents BLUEDART,&nbsp; FEDEX, &nbsp;DHELIVERY and Speed Post etc will not be able to provide sign confirmation of delivery made in such cases.</p>\r\n\r\n<p>To ensure that no disputes arise due to this, kindly make sure that someone is there to receive the package when courier delivery is attempted.</p>\r\n\r\n<p>Please note that there are no shipments made from the store on Sundays and public holidays as our logistics partner, does not make any pick-ups on those days.</p>\r\n\r\n<p><strong>Shipping gifts to India</strong></p>\r\n\r\n<p>We take great pride in being able to offer FREE SHIPPING to any address in India to our customers with family and friends back home. To ensure the quickest confirmed delivery on all orders to India, please be sure to include the COMPLETE postal address with the correct PIN CODE. We cannot be responsible for postal delays resulting from incomplete address listings.</p>\r\n\r\n<p>&nbsp;<strong>Transit times</strong></p>\r\n\r\n<p>We ship all orders by fastest possible air courier services like BLUEDART,&nbsp; FEDEX, &nbsp;DHELIVERY and Speed Post etc and they deliver within 48-72 hours.</p>\r\n\r\n<p>If you are looking for alternate shipping options, then cheaper and slower shipping options can be suggested. On request, we can also make special quotes for shipping if the merchandise order amount is large. Please write on contact@sareewali.com for more details.</p>\r\n\r\n<p>If you ordered two or more items, you may receive them in multiple boxes on different days, because of varying item availability and shipping locations. Often, products will be shipped separately from one another for added safety in transit, so you may receive more than one delivery to your address.</p>\r\n\r\n<p><strong>Transit Risk</strong></p>\r\n\r\n<p>Sareewali.com will not responsible for lost and stolen packages or any full or partial damages to the package after being left at customer&#39;s address by postal / courier agency.&nbsp;</p>\r\n\r\n<p><strong>Shipment and tracking details:&nbsp;</strong></p>\r\n\r\n<p>We will send you an email regarding the shipment of your order, as soon as the items are handed over to the Courier. These alert emails will contain the tracking number and courier companies website details along with expected date of delivery. You may also check the same on our order status page.</p>\r\n\r\n<p>Tracking numbers for orders shipped might take 24 business hours to become active on the courier websites.&nbsp;</p>\r\n\r\n<p><strong>Address change requests:&nbsp;</strong></p>\r\n\r\n<p>Once an order is registered, you cannot make any alterations. However, address alteration requests may be accommodated within 24 hours of placing the order. You may send your alteration request to contact@sareewali.com and the needful will be done.</p>\r\n\r\n<p>Multiple address order - Currently this option is not available. However, if you want to send the product to different addresses, you can place Multiple Orders.</p>\r\n\r\n<p><strong>Incorrect or incomplete address</strong></p>\r\n\r\n<p>Please note: some courier companies charge a penalty for incorrect shipping addresses, wherein the address and zip code do not match. The customer will, without exception, bear the cost of any such penalties and/or fees, not Sareewali.com. Please make sure your shipping address is correct.</p>\r\n\r\n<p>In the event of a reshipment of the same order, customers will be responsible to pay re-shipping charges for the reshipment.&nbsp;</p>\r\n\r\n<p><strong>Packing method</strong></p>\r\n\r\n<p>All products are first polythene packed then put in corrugated box. All orders are shipped by 1st class air courier services and home delivered within approximately 3-7 working days after dispatch of the shipment.</p>\r\n\r\n<p><strong>Time to Ship</strong></p>\r\n\r\n<p>For each item we have mentioned time to ship along with the item image. These are indicative &amp; approx values only and items can be shipped earlier or later also on case to case basis depending on availability of item and other factors.</p>\r\n\r\n<p>We are proud to offer such shipping values to our customers, especially when paired with our fast delivery times. In most cases, your order will be processed within 48-72 hours of your placing it. You can expect to receive your order, on average, within 7 -15 business days of placing the order.</p>\r\n\r\n<p><strong>What if any Delays</strong></p>\r\n\r\n<p>Time to ship mentioned on our website against each item are indicative and approximate values only and sometimes. Due to situations beyond our control, delays may occur. No refund, returns, replacement &amp; exchange will be entertained for this reason.</p>\r\n\r\n<p>If, for any reason, there is going to be a delay in shipping because a item is out of stock or If there is an unusual delay in filling an order, we will notify you by e-mail</p>\r\n\r\n<p>However any dates for delivery are approximate only and we are not liable for any delay in delivering your order or any part of it. We may choose to deliver your order in separate parts. In some cases we may offer to refund you for unfulfilled part of the order.</p>\r\n\r\n<p><strong>Billing Address and Shipping Address</strong></p>\r\n\r\n<p>Billing Address is the address where a customer gets his bills from the credit card company. Shipping address is the address where the customer wants to receive their shipment.</p>\r\n\r\n<p><strong>What happens if my order is lost in transit?&nbsp;</strong></p>\r\n\r\n<p>If a shipment is lost in transit, we wait for 15 days and then reprocess/reship the order.</p>\r\n\r\n<p>If you have any question about our shipping policies, we&#39;ll do our best to answer them. Please contact us at contact@sareewali.com</p>\r\n', 'shipping', 1559694821),
(5, 'About Us', '<p><span style=\"color:#000000\"><strong>Sareewali.com</strong>&nbsp;is the newly launched Online Indian traditional and modern Wear Store. Sareewali.com brings you the India&#39;s as well as world&rsquo;s finest collections and wide range of Indian&nbsp;<strong>Sarees, Salwaar Kameez&nbsp;</strong>,&nbsp;<strong>Lehenga Choli&nbsp; and other Accessories etc.</strong></span></p>\r\n\r\n<p><span style=\"color:#000000\">We are one of the leading providers of online Indian traditional wardrobes. Our&nbsp; focus is on best quality products, timely delivery, and customer&rsquo;s satisfaction. Our products are exclusively-designed to give you the real feel of Indian trend and tradition.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Sareewali.com strives to give you luxury of the in-store shopping experience through an user friendly website which offers an unparalleled collection of Indian style. Our customer-friendly features like customization and style selection, we provide an experience that is far better than many an offline store. We are proud to be leaders in style world and ethnic Indian wear. &nbsp;our products are available in various &nbsp;sizes and styles with which customers can enjoy the best custom-made apparel.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Sareewali.com has a large number of domestic and international customers. Sareewali.com take a proud to cater customers from different parts of the world.</span></p>\r\n', 'about', 1555373756),
(6, 'Wholesale Inquiry', '<p><strong>If you have any Wholesale Inquiry please email <a href=\"https://www.sareewali.com/contact\">contact@sareewali.com</a>, we&#39;ll reply within 24 hours.</strong></p>\r\n\r\n<p>Contact Number :- +91 8100 444411</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;+91 8100 344411</p>\r\n', 'feedback', 1559861196);
