(1, 'KVA00001', '<ul>\r\n	<li>Lehenga in Pure Cloths</li>\r\n</ul>\r\n', '<ul> 	<li>The first wash of the garment should always be Dry-Cleaned.</li> 	<li>The shades may vary slightly from the colors displayed on your screen.</li> 	<li>There might be slight color variation due to lightings &amp; flash while photo shoot.</li> 	<li>The bright shade seen is the best closer view of fabric&#39;s colors.</li> </ul>', 'kva00001', 'KVA00001', 'Saree, Blouse', 0, 1, 9999, 'Y', 'per', 10, 8999, 'N', 'N', 1536741513, 1559501632, '', '', ''),
(2, 'test', '<p>test</p>\r\n', '<ul> 	<li>The first wash of the garment should always be Dry-Cleaned.</li> 	<li>The shades may vary slightly from the colors displayed on your screen.</li> 	<li>There might be slight color variation due to lightings &amp; flash while photo shoot.</li> 	<li>The bright shade seen is the best closer view of fabric&#39;s colors.</li> </ul>', 'test', 'kva00003', 'Lehenga', 0, 12, 100, 'N', 'per', 10, 90, 'N', 'N', 1538647133, 1559625275, '', '', ''),
(3, 'test1', '<p>test1</p>\r\n', '<ul> 	<li>The first wash of the garment should always be Dry-Cleaned.</li> 	<li>The shades may vary slightly from the colors displayed on your screen.</li> 	<li>There might be slight color variation due to lightings &amp; flash while photo shoot.</li> 	<li>The bright shade seen is the best closer view of fabric&#39;s colors.</li> </ul>', 'test1', 'kva00004', '', 0, 1, 100, 'N', '', 0, 0, 'N', 'N', 1538851224, 0, '', '', ''),
(4, 'KVA00002', '<ul>\r\n	<li>Lehena in pure clothes</li>\r\n</ul>\r\n', '<ul>\r\n	<li>The first wash of the garment should always be Dry-Cleaned.</li>\r\n	<li>The shades may vary slightly from the colors displayed on your screen.</li>\r\n	<li>There might be slight color variation due to lightings &amp; flash while photo shoot.</li>\r\n	<li>The bright shade seen is the best closer view of fabric&#39;s colors.</li>\r\n</ul>\r\n', 'kva00002', 'KVA00002', 'Lehena', 0, 1, 9999, 'N', 'per', 20, 7999, 'N', 'N', 1538935693, 1565845740, '', '', ''),
(5, 'Aaina Check Buti Tant Saree', '<p>Aaina Check Buti</p>\r\n', '<ul>\r\n	<li>The first wash of the garment should always be Dry-Cleaned.</li>\r\n	<li>The shades may vary slightly from the colors displayed on your screen.</li>\r\n	<li>There might be slight color variation due to lightings &amp; flash while photo shoot.</li>\r\n	<li>The bright shade seen is the best closer view of fabric&#39;s colors.</li>\r\n</ul>\r\n', 'aaina-check-buti-tant-saree', 'FGS00001', 'Saree', 0, 9, 99999, 'Y', 'per', 5, 94999, 'N', 'N', 1550385335, 1563603614, '', '', ''),
(6, 'Jamdani Red', '<ul>\r\n	<li>Due to the exquisite painstaking methodology required, only aristocrats and royal families were able to afford such luxuries which are now offered to appease your refined senses by mycraftsindia.com at the most reasonable rates.</li>\r\n	<li>This red colour saree has been made from a mixed fabric and the Jamdani work is done with the golden thread.</li>\r\n	<li>Floral and geometrical motifs have been woven on the saree with much perfection by the artists adept in this traditional art.</li>\r\n	<li>Explore our vast range of Jamdani sarees and choose the colour and design of your choice as per the occasion.</li>\r\n</ul>\r\n', '<ul>\r\n	<li>The first wash of the garment should always be Dry-Cleaned.</li>\r\n	<li>The shades may vary slightly from the colors displayed on your screen.</li>\r\n	<li>There might be slight color variation due to lightings &amp; flash while photo shoot.</li>\r\n	<li>The bright shade seen is the best closer view of fabric&#39;s colors.</li>\r\n</ul>\r\n', 'jamdani', 'FGS00002', 'Saree', 0, 9, 2200, 'Y', 'per', 20, 1760, 'N', 'Y', 1552711003, 1564173513, '', '', ''),
(7, 'Jamdani Sky Blue and white Color', '<ul>\r\n	<li>What&rsquo;s remarkable in the weaving technique used in making Jamdani sarees is that the pattern is not sketched or outlined on the fabric. Instead, it is drawn on a graph paper and placed underneath the warp.</li>\r\n	<li>Jamdani patterns are mostly of geometric, plant, and floral designs and are said to have originated thousands of years ago.</li>\r\n	<li>This is a saree in double colours, i.e. white and blue. Jamdani work has been done with blue colour thread on the cotton fabric.</li>\r\n	<li>Choose your favourite colour from amongst the range of colours available with us.&nbsp;</li>\r\n</ul>\r\n', '<ul>\r\n	<li>The first wash of the garment should always be Dry-Cleaned.</li>\r\n	<li>The shades may vary slightly from the colors displayed on your screen.</li>\r\n	<li>There might be slight color variation due to lightings &amp; flash while photo shoot.</li>\r\n	<li>The bright shade seen is the best closer view of fabric&#39;s colors.</li>\r\n</ul>\r\n', 'jamdani-sky-blue-and-white-color', 'FGS00003', 'Saree', 0, 9, 2200, 'Y', 'per', 20, 1760, 'N', 'Y', 1552714013, 1564173604, '', '', ''),
(8, 'Jamdani Black Color', '<ul>\r\n	<li>This elegantly designed Jamdani saree has floral and geometrical motifs woven all over it. The saree is of blue colour and the Jamdani work has been done with golden thread.</li>\r\n	<li>Fine detailing done all over the saree with woven border in golden colour thread.</li>\r\n	<li>This saree is a perfect buy for any party that is approaching. You can pair it with a golden blouse and golden heels.</li>\r\n	<li>A supplementary weft technique of weaving, in the Jamdani weave, the artistic motifs is produced by a non-structural weft in addition to the standard weft that holds the warp threads together. The standard weft creates a fine, sheer fabric while the supplementary weft with thicker threads adds the intricate patterns to it.<br />\r\n	&nbsp;</li>\r\n</ul>\r\n', '<ul>\r\n	<li>The first wash of the garment should always be Dry-Cleaned.</li>\r\n	<li>The shades may vary slightly from the colors displayed on your screen.</li>\r\n	<li>There might be slight color variation due to lightings &amp; flash while photo shoot.</li>\r\n	<li>The bright shade seen is the best closer view of fabric&#39;s colors.</li>\r\n</ul>\r\n', 'jamdani-black-color', 'FGS00004', 'Saree', 0, 9, 2200, 'Y', 'per', 20, 1760, 'N', 'Y', 1552714390, 1564173025, '', '', ''),
(9, 'Jamdani Yellow Color', '<ul>\r\n	<li>Each supplementary weft motif in the Jamdani saree is added separately by hand by interlacing the weft threads into the warp with fine bamboo sticks using individual spools of thread.</li>\r\n	<li>The result is a myriad of vibrant patterns that appear to float on a shimmering surface.</li>\r\n	<li>This yellow coloured Jamdani saree is so pleasing to the eyes.</li>\r\n	<li>It has been woven with the same coloured cotton thread which gives a decent look to the saree. This saree will fit in for just any occasion.</li>\r\n	<li>The details have been done quite finely all over the cotton fabric. Explore our wide range of colourful Jamdani sarees and buy one as soon as possible.</li>\r\n</ul>\r\n', '<ul>\r\n	<li>The first wash of the garment should always be Dry-Cleaned.</li>\r\n	<li>The shades may vary slightly from the colors displayed on your screen.</li>\r\n	<li>There might be slight color variation due to lightings &amp; flash while photo shoot.</li>\r\n	<li>The bright shade seen is the best closer view of fabric&#39;s colors.</li>\r\n</ul>\r\n', 'jamdani-yellow-color', 'FGS00005', 'Saree', 0, 9, 2200, 'Y', 'per', 20, 1760, 'N', 'Y', 1552714598, 1564173426, '', '', ''),
(10, 'Jamdani Punch Color', '<ul>\r\n	<li>Introducing the spectacular collection of designer patterns hot pink colour mixed resham silk Jamdani saree. This drape is thoroughly covered with geometric patterns and flowers, tribal motifs using silk thread. This makes the saree quite exclusive in nature.</li>\r\n	<li>Jamdani Sarees are mostly worn at the time of festivals, marriage party &amp; any special event that needs exclusive attire.</li>\r\n	<li>The silver colour embroidery on the pink saree gives an exclusive look to the product. You can match it with any silver coloured blouse.</li>\r\n	<li>Explore our wide range of Jamdani sarees and choose the colour of your choice.</li>\r\n</ul>\r\n', '<ul>\r\n	<li>The first wash of the garment should always be Dry-Cleaned.</li>\r\n	<li>The shades may vary slightly from the colors displayed on your screen.</li>\r\n	<li>There might be slight color variation due to lightings &amp; flash while photo shoot.</li>\r\n	<li>The bright shade seen is the best closer view of fabric&#39;s colors.</li>\r\n</ul>\r\n', 'jamdani-punch-color', 'FGS00006', 'Saree', 0, 9, 2200, 'Y', 'per', 20, 1760, 'N', 'Y', 1552715068, 1564173193, '', '', ''),
(11, 'Jamdani Blue Color', '<ul>\r\n	<li>This elegantly designed Jamdani saree has floral and geometrical motifs woven all over it. The saree is of blue colour and the Jamdani work has been done with golden thread.</li>\r\n	<li>Fine detailing done all over the saree with woven border in golden colour thread.</li>\r\n	<li>This saree is a perfect buy for any party that is approaching. You can pair it with a golden blouse and golden heels.</li>\r\n	<li>A supplementary weft technique of weaving, in the Jamdani weave, the artistic motifs is produced by a non-structural weft in addition to the standard weft that holds the warp threads together. The standard weft creates a fine, sheer fabric while the supplementary weft with thicker threads adds the intricate patterns to it.</li>\r\n</ul>\r\n', '<ul>\r\n	<li>The first wash of the garment should always be Dry-Cleaned.</li>\r\n	<li>The shades may vary slightly from the colors displayed on your screen.</li>\r\n	<li>There might be slight color variation due to lightings &amp; flash while photo shoot.</li>\r\n	<li>The bright shade seen is the best closer view of fabric&#39;s colors.</li>\r\n</ul>\r\n', 'jamdani-blue-color', 'FGS00007', 'Saree', 2, 7, 2200, 'Y', 'per', 20, 1760, 'N', 'Y', 1552715401, 1612002533, 'Jamdani Blue Color', 'Jamdani', 'Jamdami'),
(12, 'Outstanding Embroidery Work Purse', '<ul>\r\n	<li>A hand purse is needed by almost all the women. How about a purse made from a perfectly eco-friendly material.</li>\r\n	<li>This purse is made from black coloured cotton cloth. The front of the bag has been embroidered with the floral designs and the images of birds sitting on the branches of tree.</li>\r\n	<li>The other part of the hand purse is kept simple with embroidered dots in red and yellow colours.</li>\r\n	<li>A plastic handle is attached to the bag which looks like a wooden.Explore our wide range of embroidery hand bags and choose the one that suits your requirements.</li>\r\n</ul>\r\n', '<ul>\r\n	<li>The first wash of the garment should always be Dry-Cleaned.</li>\r\n	<li>The shades may vary slightly from the colors displayed on your screen.</li>\r\n	<li>There might be slight color variation due to lightings &amp; flash while photo shoot.</li>\r\n	<li>The bright shade seen is the best closer view of fabric&#39;s colors.</li>\r\n</ul>\r\n', 'outstanding-embroidery-work-purse', 'EPMC0001', 'Embroidery Work Purse', 0, 5, 999, 'Y', 'per', 20, 799, 'N', 'Y', 1560445234, 1564158125, '', '', ''),
(13, 'Brilliant Embroidery Work Purse', '<ul>\r\n	<li>The front portion of the bag has beautifully embroidered floral designs in red and yellow colours.</li>\r\n	<li>Apart from the main zip fastened to it, the bag also has a small pocket inside it.</li>\r\n	<li>The back portion of the bag is also embellished with the dotted embroidery in yellow and brown colours.</li>\r\n	<li>This trendy looking bag can be carried with style and elegance any where you go.</li>\r\n	<li>That suits your requirements.</li>\r\n</ul>\r\n', '<ul>\r\n	<li>The first wash of the garment should always be Dry-Cleaned.</li>\r\n	<li>The shades may vary slightly from the colors displayed on your screen.</li>\r\n	<li>There might be slight color variation due to lightings &amp; flash while photo shoot.</li>\r\n	<li>The bright shade seen is the best closer view of fabric&#39;s colors.</li>\r\n</ul>\r\n', 'brilliant-embroidery-work-purse', 'EPMC0002', 'Embroidery Work Purse', 0, 5, 999, 'Y', 'per', 20, 799, 'N', 'Y', 1560477779, 1564158093, '', '', ''),
(14, 'Dazzling Embroidery Work Purse', '<ul>\r\n	<li>This beige coloured hand bag has been made from raw cotton cloth. The canvas material sewn inside it gives it a briefcase-like shape.</li>\r\n	<li>The front portion of the bag has beautifully embroidered floral designs in red and blue colours. Apart from the main zip fastened to it which extends almost up to the ends, the bag also has a small pocket inside it.</li>\r\n	<li>The back portion of the bag is also embellished with the dotted embroidery in red and white colours.</li>\r\n	<li>Explore our diverse range of embroidered purses and buy this trendy looking bag that can be carried with style and elegance any where you go.</li>\r\n</ul>\r\n', '<ul>\r\n	<li>The first wash of the garment should always be Dry-Cleaned.</li>\r\n	<li>The shades may vary slightly from the colors displayed on your screen.</li>\r\n	<li>There might be slight color variation due to lightings &amp; flash while photo shoot.</li>\r\n	<li>The bright shade seen is the best closer view of fabric&#39;s colors.</li>\r\n</ul>\r\n', 'dazzling-embroidery-work-purse', 'EPMC0003', 'Embroidery Work Purse', 0, 5, 999, 'Y', 'per', 20, 799, 'N', 'Y', 1560478099, 1564158073, '', '', ''),
(15, 'Adorable Embroidery Work Purse', '<ul>\r\n	<li>This beige coloured hand bag has been made from raw cotton cloth. The canvas material sewn inside it gives it a briefcase-like shape.</li>\r\n	<li>The front portion of the bag has beautifully embroidered floral designs in red and yellow colours. Also, lovely figures of birds chirping on the branches and two peacocks sitting face o face are embroidered beautifully.</li>\r\n	<li>The back portion of the bag is also embellished with the dotted embroidery in red and white colours.</li>\r\n	<li>Explore our diverse range of embroidered purses and buy this trendy looking bag that can be carried with style and elegance any where you go.</li>\r\n</ul>\r\n', '<ul>\r\n	<li>Dip in a soft cloth, squeeze out excess liquid, and blot away grime.</li>\r\n	<li>Take a little extra time on very soiled areas.</li>\r\n	<li>Hold the cloth under running water to remove suds, then wring well; use it to wipe the soap off your bag.</li>\r\n	<li>Finally, with a clean, absorbent cloth (like a dishtowel), buff blot fabric dry.</li>\r\n</ul>\r\n', 'adorable-embroidery-work-purse', 'EPMC0004', 'Embroidery Work Purse', 0, 5, 999, 'Y', 'per', 20, 799, 'N', 'Y', 1560478392, 1564158052, '', '', ''),
(16, 'Enchanting Embroidery Work Purse', '<ul>\r\n	<li>This hand bag is made of black coloured cotton cloth and is shaped like a briefcase. It is quite spacious and can carry a lot of your daily stuff.</li>\r\n	<li>One face of the bag has been embroidered with big flowers with yellow and white colour threads of fine quality.</li>\r\n	<li>The use of different colours for embroidering other buds and leaves is just mind blowing.</li>\r\n	<li>The other face of the bag is embroidered with red and yellow dots.</li>\r\n	<li>The elegant handles made of fibre are unbreakable and give a brilliant look to the entire hand bag.</li>\r\n</ul>\r\n', '<ul>\r\n	<li>The first wash of the garment should always be Dry-Cleaned.</li>\r\n	<li>The shades may vary slightly from the colors displayed on your screen.</li>\r\n	<li>There might be slight color variation due to lightings &amp; flash while photo shoot.</li>\r\n	<li>The bright shade seen is the best closer view of fabric&#39;s colors.</li>\r\n</ul>\r\n', 'enchanting-embroidery-work-purse', 'EPMC0005', 'Embroidery Work Purse', 0, 5, 999, 'Y', 'per', 20, 799, 'N', 'Y', 1560478763, 1564158141, '', '', ''),
(17, 'Amazing Embroidery Work Black Shopping Bag', '<ul>\r\n	<li>This black coloured shopping bag is a perfect match with all kinds of outfits. You can use it while going to a party or carry it along with you on a casual trip.</li>\r\n	<li>&nbsp;Flowers&nbsp;Design have been embroidered with red and yellow coloured threads of the finest quality.&nbsp;</li>\r\n	<li>The embroidery done on this shopping bag is of superior quality and skill and is done by the highly skilled artists working with us.</li>\r\n	<li>Explore our wide range of lovely and stylish hand bag and place your order soon.</li>\r\n</ul>\r\n', '<ul>\r\n	<li>The first wash of the garment should always be Dry-Cleaned.</li>\r\n	<li>The shades may vary slightly from the colors displayed on your screen.</li>\r\n	<li>There might be slight color variation due to lightings &amp; flash while photo shoot.</li>\r\n	<li>The bright shade seen is the best closer view of fabric&#39;s colors.</li>\r\n</ul>\r\n', 'amazing-embroidery-work-black-shopping-bag', 'EPMC0006', 'Purse', 0, 2, 1199, 'Y', 'per', 20, 959, 'N', 'Y', 1564157701, 1564170701, '', '', ''),
(18, 'Royal Blue Embroidered Shopping Bag', '<ul>\r\n	<li>Royal blue is the colour of royalty, attraction, and captivates everyone.</li>\r\n	<li>This beautiful royal blue handbag which is being designed with stunning dual shade embroidery is something you cannot miss to buy.</li>\r\n	<li>It is the bag that will assist you in the shopping, travelling and even in small parties if you have lot many things to carry with you.</li>\r\n	<li>Available at a very small price, this piece is the best for gifting purposes as well.</li>\r\n</ul>\r\n', '<ul>\r\n	<li>The first wash of the garment should always be Dry-Cleaned.</li>\r\n	<li>The shades may vary slightly from the colors displayed on your screen.</li>\r\n	<li>There might be slight color variation due to lightings &amp; flash while photo shoot.</li>\r\n	<li>The bright shade seen is the best closer view of fabric&#39;s colors.</li>\r\n</ul>\r\n', 'royal-blue-embroidered-shopping-bag', 'EPMC0007', 'Purse', 0, 2, 1199, 'Y', 'per', 20, 959, 'N', 'Y', 1564214780, 1564214825, '', '', ''),
(19, 'Multicolour Flower Embroidery Black Handbag', '<ul>\r\n	<li>When going out for shopping, having a stylish bag is a must for every woman.</li>\r\n	<li>It just not let you keep the things to shop, but also showcase the style that you wear while shopping.</li>\r\n	<li>This black classic handbag with purple and yellow flower embroidery on the left side of the bag and fully filled double shade dots is most attractive piece in our stock for you.</li>\r\n	<li>Don&rsquo;t miss buying this now.</li>\r\n</ul>\r\n', '<ul>\r\n	<li>The first wash of the garment should always be Dry-Cleaned.</li>\r\n	<li>The shades may vary slightly from the colors displayed on your screen.</li>\r\n	<li>There might be slight color variation due to lightings &amp; flash while photo shoot.</li>\r\n	<li>The bright shade seen is the best closer view of fabric&#39;s colors.</li>\r\n</ul>\r\n', 'multicolour-flower-embroidery-black-handbag', 'EPMC0008', 'Purse', 0, 3, 1199, 'Y', 'per', 20, 959, 'N', 'Y', 1564215208, 1564215235, '', '', ''),
(20, 'Beautiful Embroidery Shopping Handbag', '<ul>\r\n	<li>White is the colour of sobriety, simplicity, and gracefulness.</li>\r\n	<li>This beautiful white coloured handbag, with red and yellow flower embroidery, is superbly awesome for your shopping bag collection.</li>\r\n	<li>This will complement every colour and style you wear while hanging out with friends or while doing some shopping.</li>\r\n	<li>With enough space, it will let you put in petty important things as well.</li>\r\n</ul>\r\n', '<ul>\r\n	<li>The first wash of the garment should always be Dry-Cleaned.</li>\r\n	<li>The shades may vary slightly from the colors displayed on your screen.</li>\r\n	<li>There might be slight color variation due to lightings &amp; flash while photo shoot.</li>\r\n	<li>The bright shade seen is the best closer view of fabric&#39;s colors.</li>\r\n</ul>\r\n', 'beautiful-embroidery-shopping-handbag', 'EPMC0009', 'Purse', 0, 5, 1199, 'Y', 'per', 20, 959, 'N', 'Y', 1564215527, 1564259980, '', '', ''),
(21, 'Beige Multicolour Flower Embroidery Clutch', '<ul>\r\n	<li>If you wish to set a unique style statement among your friends and relatives and want to look just different, then you need to have beautiful accessories to carry with your pretty ethnic dress.</li>\r\n	<li>You must buy this for any part occasion to make your appearance graceful.&nbsp;</li>\r\n	<li>This amazing hand clutch is designed in a sophisticated manner not just to help you look stylish, but also to make you keep some utility items in it very safely.</li>\r\n	<li>The black flap cover on the white base purse makes it stunning and classier.</li>\r\n	<li>The embroidery on the flap is very neat in the shades of red and yellow which is the best colour combination.</li>\r\n</ul>\r\n', '<p>Wash with Care</p>\r\n', 'beige-multicolour-flower-embroidery-clutch', 'EPMC0010', 'Embroidery Work', 0, 9, 499, 'Y', 'per', 20, 399, 'N', 'Y', 1565632101, 1565632118, '', '', ''),
(22, 'Beige Multicolour Flower Embroidery Clutch 2', '<ul>\r\n	<li>Small and pretty items are self-attractive and gather the attention of almost everyone. The small pretty flowers in this beautiful clutch also have the same trait.</li>\r\n	<li>Being designed with multiple colours and different pattern, the bunch of flowers on the right top corner of the clutch is very attractive.</li>\r\n	<li>The other side of the clutch has checks made with the red colour thread which are complementing the colour and the pattern of the clutch as a whole.</li>\r\n</ul>\r\n', '<p>Wash</p>\r\n', 'beige-multicolour-flower-embroidery-clutch-2', 'EPMC0011', 'Embroidery Clutch', 0, 2, 499, 'Y', 'per', 20, 399, 'N', 'Y', 1565739681, 1565741180, '', '', ''),
(23, 'Beautiful Red & Yellow Embroidery Flower Beige Clutch 1', '<ul>\r\n	<li>Carrying clutch is the most stylish attire nowadays and we have a sophisticated range of embroidered purses which have stunning designing in the shades of yellow and red, how can you miss it?</li>\r\n	<li>Both the sides of the purse are superbly designed in a very classic form to give your attire the best compliment.</li>\r\n	<li>You must not miss out this class piece of cream shade to match all your dresses.</li>\r\n</ul>\r\n', '<p>wash</p>\r\n', 'beautiful-red-yellow-embroidery-flower-beige-clutch-1', 'EPMC0012', 'Embroidery Clutch', 0, 8, 499, 'Y', 'per', 20, 399, 'N', 'Y', 1565741956, 1565742850, '', '', ''),
(24, 'Elegant Floral Embroidery Party Clutch 1', '<ul>\r\n	<li>White is the colour of sobriety, simplicity, and gracefulness.</li>\r\n	<li>This beautiful white coloured handbag, with red and yellow flower embroidery, is superbly awesome for your shopping bag collection.</li>\r\n	<li>This will complement every colour and style you wear while hanging out with friends or while doing some shopping.</li>\r\n	<li>With enough space, it will let you put in petty important things as well.</li>\r\n</ul>\r\n', '<p>Wash</p>\r\n', 'elegant-floral-embroidery-party-clutch-1', 'EPMC0013', 'Embroidery Clutch', 0, 2, 499, 'Y', 'per', 20, 399, 'N', 'Y', 1565742191, 1565742860, '', '', ''),
(25, 'Beige Colored Embroidery Party Clutch ', '<ul>\r\n	<li>The base of white with red coloured embroidery flowers are stunning that can&rsquo;t be missed at any cost.</li>\r\n	<li>This small sized purse with solid handle is very captivating as well as easy to carry in parties or elsewhere.&nbsp;</li>\r\n	<li>The beautiful embroidery of red flowers is being made with high-quality thread and the entire front of the purse is decorated with the leaves of the flowers adjoined altogether.</li>\r\n	<li>The back of the purse also has dotted embroidery work that looks very graceful.</li>\r\n</ul>\r\n', '<p>Wash</p>\r\n', 'beige-colored-embroidery-party-clutch', 'EPMC0014', 'Embroidery Clutch', 0, 3, 499, 'Y', 'per', 20, 399, 'N', 'Y', 1565742484, 1565742867, '', '', ''),
(26, 'Beige Coloured Multishade Embroidered Purse', '<ul>\r\n	<li>This wonderful and simple clutch in the shade of beige on which multicolour embroidery is being made is a perfect item for those who are looking for a beautiful clutch to carry with their ethnic attire for the party or other occasion.</li>\r\n	<li>The handmade embroidery on the flower is very elegant and neat and has made this article stunning for all the purposes.</li>\r\n	<li>This can also be purchased for gifting to your friend or relative.</li>\r\n</ul>\r\n', '<p>Wash</p>\r\n', 'beige-coloured-multishade-embroidered-purse', 'EPMC0015', 'Embroidery Clutch', 0, 3, 499, 'Y', 'per', 20, 399, 'N', 'Y', 1565742746, 0, '', '', ''),
