(42, 'Marvelous Embroidery Work Clutch Red and Purple', '<ul>\r\n	<li>Clutches of various shapes and sizes are available on mycraftsindia.com.This clutch is made from beige coloured raw cotton cloth.</li>\r\n	<li>A canvas is stitched with the cloth to provide it the required strength. This clutch has a zip fastened to it on the top.</li>\r\n	<li>The front part of the clutch is embroidered with flowers of purple and red colours. The leaves have been made with shaded embroidery of light and dark green colours.</li>\r\n	<li>Explore the large variety of hand clutches available on our website and choose the design that pleases you the most.</li>\r\n</ul>\r\n', '<p>Dry Wash</p>\r\n', 'marvelous-embroidery-work-clutch-red-and-purple', 'EPMC0031', 'Embroidery Clutch', 0, 10, 499, 'Y', 'per', 20, 399, 'N', 'Y', 1566865381, 1566865846, '', '', ''),
(43, 'Yellow Hand Purse with Floral Embroidery Pink and Blue', '<ul>\r\n	<li>Here is an attractive yellow coloured pretty hand purse to carry with the classy ethnic attire of yellow colour.</li>\r\n	<li>The embroidery work on this purse in the design of flowers of pink and purple combination makes it look fabulous.</li>\r\n	<li>Both the sides of the purse are well decorated and the fabric used on the base is shiny and glossy making it a perfect party item.</li>\r\n	<li>You can carry this with a sari, a lehenga or a simple ethnic kurti in the shade of yellow or multicolour.</li>\r\n</ul>\r\n', '<p>Dry Wash</p>\r\n', 'yellow-hand-purse-with-floral-embroidery-pink-and-blue', 'EPMC0032', 'Embroidery Clutch', 0, 2, 499, 'Y', 'per', 20, 399, 'N', 'Y', 1566865518, 1566923719, '', '', ''),
(44, 'Green Embroidery Best Complimentary Yellow Clutch Green', '<ul>\r\n	<li>Yellow and blue have the best combination as it helps in making your designer wear more stylish; and this pretty clutch with a yellow base and turquoise flowers are what you need to carry now.</li>\r\n	<li>Being designed with classic embroidery on both the sides of the clutch, this purse is being made superb art and craft by the craftsman of mycraftsindia.</li>\r\n</ul>\r\n', '<p>Dry Wash</p>\r\n', 'green-embroidery-best-complimentary-yellow-clutch-green', 'EPMC0033', 'Embroidery Clutch', 0, 5, 499, 'Y', 'per', 20, 399, 'N', 'Y', 1566886327, 1566888131, '', '', ''),
(45, 'Fabulous Embroidery Work Clutch Red, Blue and Green', '<ul>\r\n	<li>Preparing for a party? Wondering which colour clutch purse to buy that will go with all the dresses?This product at mycraftsindia.com is a perfect solution for your problems.</li>\r\n	<li>This clutch is rightly sized to suit all your party requirements. The colour of the purse is chosen to give an elegant look.</li>\r\n	<li>Threads of different vibrant colours have been used to make the embroidery on the clutch. Flowers and birds have been made on the front portion of this clutch.</li>\r\n	<li>The back portion of this clutch has been embroidered with dotted designs. Buy this beautiful clutch only on mycraftsindia.com.</li>\r\n</ul>\r\n', '<p>Dry Wash</p>\r\n', 'fabulous-embroidery-work-clutch-red-blue-and-green', 'EPMC0034', 'Embroidery Clutch', 0, 5, 499, 'Y', 'per', 20, 399, 'N', 'Y', 1566886587, 1566922917, '', '', ''),
(46, 'Golden Clutch with Classic Floral Embroidery Work Red and Purple', '<ul>\r\n	<li>Do you love golden colour? Are you fond of carrying a stylish clutch with your ethnic attire?</li>\r\n	<li>If yes, then here we have the super classy golden colour full embroidery hand clutch with floral designing on the front and back.</li>\r\n	<li>The red and purple flowers on the base of golden yellow colour are enhancing the grace of this beautiful embroidery.</li>\r\n	<li>Being designed using the handicraft techniques, this classy purse is stunning and a must-have for every woman who loves carrying stylish clutches.</li>\r\n</ul>\r\n', '<p>Dry Wash</p>\r\n', 'golden-clutch-with-classic-floral-embroidery-work-red-and-purple', 'EPMC0035', 'Embroidery Clutch', 0, 2, 499, 'Y', 'per', 20, 399, 'N', 'Y', 1566886779, 1566923023, '', '', ''),
(47, 'Beautifully Embroidered Floral Design Hand Purse Red and Yellow', '<ul>\r\n	<li>Here is a pretty piece of the purse for you. If you are a yellow lover and loves wearing pretty yellow dresses, then this wonderful clutch in the shade of yellow is the best item for you at mycrafts.</li>\r\n	<li>Embroidered with multi shades of threads, the floral work on the front of the clutch is very classy and elegant.</li>\r\n	<li>Both the sides of the purse are fabulously beautiful and this purse can be carried anywhere on the yellow ethnic attire.</li>\r\n</ul>\r\n', '<p>Dry Wash</p>\r\n', 'beautifully-embroidered-floral-design-hand-purse-red-and-yellow', 'EPMC0036', 'Embroidery Clutch', 0, 3, 499, 'Y', 'per', 20, 399, 'N', 'Y', 1566886929, 1566923859, '', '', ''),
(48, 'Stunning Embroidery Work Black Purse Red Yellow Green', '<ul>\r\n	<li>Black is the colour of class and grace and having a black dress or a purse is desired by every woman.</li>\r\n	<li>This classy black clutch with stunning embroidery work is being designed for every such woman.</li>\r\n	<li>Completely filled with multicolour embroidery having the design of birds, flowers, and leaves altogether, this black clutch will complement your style in a very sophisticated way.</li>\r\n	<li>So, just don&rsquo;t miss buying this for your new black ethnic wear.</li>\r\n</ul>\r\n', '<p>Dry Wash</p>\r\n', 'stunning-embroidery-work-black-purse-red-yellow-green', 'EPMC0037', 'Embroidery Clutch', 0, 5, 499, 'Y', 'per', 20, 399, 'N', 'Y', 1566887071, 1566923887, '', '', ''),
(49, 'Golden Clutch with Classic Floral Embroidery Work Red and Blue', '<ul>\r\n	<li>Flowers have their own grace which is demonstrated by the beauty of their design, colour and attractive look.</li>\r\n	<li>This shopping has completely showcased the same with the ultimate embroidered flowers of red and yellow colour.</li>\r\n	<li>With enough space and easy-to-carry handle, this purse is the first choice for every woman who loves carrying a stylish and convenient bag while shopping, if you too are among them, then don&rsquo;t miss this out.</li>\r\n</ul>\r\n', '<p>Dry Wash</p>\r\n', 'golden-clutch-with-classic-floral-embroidery-work-red-and-blue', 'EPMC0038', 'Embroidery Clutch', 0, 2, 499, 'Y', 'per', 20, 399, 'N', 'Y', 1566887278, 1566924353, '', '', ''),
(50, 'Classic Black Coloured Clutch with Stunning Embroidery Red and Yellow', '<ul>\r\n	<li>Have you been looking for some classy collection of hand clutches?</li>\r\n	<li>Well, here we end your search with the heavy range of colourful clutches embroidered with high-quality thread.</li>\r\n	<li>This black clutch has a classic embroidery work in the shades of red and yellow, which look fabulous and stunning.</li>\r\n	<li>You may carry this with your black kurti or any other ethnic attire to look different and stylish. Its availability at a very small price makes it even more desirable.</li>\r\n</ul>\r\n', '<p>Dry Wash</p>\r\n', 'classic-black-coloured-clutch-with-stunning-embroidery-red-and-yellow', 'EPMC0039', 'Embroidery Clutch', 0, 3, 499, 'Y', 'per', 20, 399, 'N', 'Y', 1566887447, 1566923957, '', '', ''),
(51, 'Adorable Embroidery work Red Purse Blue and Multicolor', '<ul>\r\n	<li>This red coloured clutch purse has been embroidered with two large sized birds in blue colour threads. The embroidery has been accomplished with great skill by our talented artists.</li>\r\n	<li>A red coloured zip has been fastened to the top of the purse. It is a spacious hand clutch which is a perfect product to buy for if you plan to go to a party.</li>\r\n	<li>The stylish and graceful look of the clutch is amazing to the eyes of the viewers. The back portion of the clutch has been embroidered with dotted embroidery.</li>\r\n	<li>Explore our vast range of colourfully designed hand clutches at unbelievable prices.</li>\r\n</ul>\r\n', '<p>Dry Wash</p>\r\n', 'adorable-embroidery-work-red-purse-blue-and-multicolor', 'EPMC0040', 'Embroidery Clutch', 0, 9, 499, 'Y', 'per', 20, 399, 'N', 'Y', 1566887582, 1566924329, '', '', ''),
(52, 'Fantastic Embroidery Work Clutch Black, Red and Yellow', '<ul>\r\n	<li>Black is the colour of class and grace and having a black dress or a purse is desired by every woman.</li>\r\n	<li>This classy black clutch with stunning embroidery work is being designed for every such woman.&nbsp;</li>\r\n	<li>Completely filled with dual shade red and yellow floral embroidery, this black clutch will complement your style in a very sophisticated way.</li>\r\n	<li>So, just don&rsquo;t miss buying this for your new black ethnic wear.</li>\r\n</ul>\r\n', '<p>Dry Wash</p>\r\n', 'fantastic-embroidery-work-clutch-black-red-and-yellow', 'EPMC0041', 'Embroidery Clutch', 0, 7, 499, 'Y', 'per', 20, 399, 'N', 'Y', 1566887725, 1566924024, '', '', ''),
(53, 'Pink Flower Embroidery Stylish Clutch Red and Orange', '<ul>\r\n	<li>Black purse is the love of every woman because of the class that it carries, and when it is combined with so beautiful and sophisticated embroidery of multicolour flowers, it just fulfils the very need of carrying an ethnic purse.</li>\r\n	<li>This amazingly designed embroidered purse with the base of black is very pretty to carry with any coloured dress for a night or day party.</li>\r\n	<li>It will definitely compliment your style in the best way.</li>\r\n</ul>\r\n', '<p>1.This Embroidered Handbags shoud be Carried out for dry clean as these are very delicate in nature.</p>\r\n\r\n<p>2. This bags can be cleaned gently by immersing it in cleaning fluid or by applying some cleaning spray to remove dirts, stains, bad smells and clutter on its surface.</p>\r\n\r\n<p>3. Color may vary slightly from the real piece which is being displaced on screen because of lightings and Flashes during photoshoot.</p>\r\n\r\n<p>4. This Trendy latest Fashionable bag add a pleasant view to the everyday Fashions.</p>\r\n\r\n<p>5. This Exquisite piece displayed on Screen is the best adjacent view of the colours among Fabrics.</p>\r\n', 'pink-flower-embroidery-stylish-clutch-red-and-orange', 'EPMC0042', 'Embroidery Clutch', 0, 5, 499, 'Y', 'per', 20, 399, 'N', 'Y', 1566927847, 1567034982, '', '', ''),
(54, 'Yellow Coloured Purse with Classic Purple Floral Embroidery Purple', '<ul>\r\n	<li>Orchard yellow has its own grace and look very attractive in almost everything whether it be a dress, purse, or a top.</li>\r\n	<li>This classic well embroidered orchard yellow clutch is also an eye-catchy article we have.</li>\r\n	<li>The small purple flowers with green leaves being created with high quality thread work are looking very pretty on the base of yellow and enhancing the classic beauty of this bag.</li>\r\n	<li>This clutch can be carried with any ethnic attire in day or night, big or small parties.</li>\r\n</ul>\r\n', '<p>1.This Embroidered Handbags shoud be Carried out for dry clean as these are very delicate in nature.</p>\r\n\r\n<p>2. This bags can be cleaned gently by immersing it in cleaning fluid or by applying some cleaning spray to remove dirts, stains, bad smells and clutter on its surface.</p>\r\n\r\n<p>3. Color may vary slightly from the real piece which is being displaced on screen because of lightings and Flashes during photoshoot.</p>\r\n\r\n<p>4. This Trendy latest Fashionable bag add a pleasant view to the everyday Fashions.</p>\r\n\r\n<p>5. This Exquisite piece displayed on Screen is the best adjacent view of the colours among Fabrics.</p>\r\n', 'yellow-coloured-purse-with-classic-purple-floral-embroidery-purple', 'EPMC0043', 'Embroidery Clutch', 0, 2, 499, 'Y', 'per', 20, 399, 'N', 'Y', 1566927977, 1566929424, '', '', '');
