(59, 'Red Embroidery Clutch with Pink Flowers Green', '<ul>\r\n	<li>Clutches need to be carried when you are wearing some pretty ethnic attire and going to a party where you ignore carrying big bags.</li>\r\n	<li>This clutch in the shade of red is a very attractive piece that we have in our collection for you.&nbsp;</li>\r\n	<li>The beautiful purple flowers with leaves all around look stunning and very attractive.</li>\r\n	<li>You must not miss buying this pretty article available at a very small price. It is also a perfect item to gift to your friend or sister.</li>\r\n	<li>Clutches need to be carried when you are wearing some pretty ethnic attire and going to a party where you ignore carrying big bags.</li>\r\n	<li>This clutch in the shade of red is a very attractive piece that we have in our collection for you.</li>\r\n</ul>\r\n', '<p>1.This Embroidered Handbags shoud be Carried out for dry clean as these are very delicate in nature.</p>\r\n\r\n<p>2. This bags can be cleaned gently by immersing it in cleaning fluid or by applying some cleaning spray to remove dirts, stains, bad smells and clutter on its surface.</p>\r\n\r\n<p>3. Color may vary slightly from the real piece which is being displaced on screen because of lightings and Flashes during photoshoot.</p>\r\n\r\n<p>4. This Trendy latest Fashionable bag add a pleasant view to the everyday Fashions.</p>\r\n\r\n<p>5. This Exquisite piece displayed on Screen is the best adjacent view of the colours among Fabrics.</p>\r\n', 'red-embroidery-clutch-with-pink-flowers-green', 'EPMC0048', 'Embroidery Clutch', 0, 1, 499, 'Y', 'per', 20, 399, 'N', 'Y', 1566929060, 1605423343, '', '', ''),
(60, 'Enchanting Antique Brass Statue of Lord Ganesh', '<ul>\r\n	<li>This piece is a unique and mesmerizing article that will enhance the beauty of your home decor and bring prosperity and happiness altogether.</li>\r\n	<li>Design your home distinctly with this inexplicable charming brass made Ganesha statue which is handcrafted by the artisans based in Kolkata. This will create an aura of elegance and beauty across you house.</li>\r\n	<li>This brass statue must be bought to bring in peace and good luck to your home and decor. The Shining of brass has made this Ganesha statue even more elegant and you must have it in your collection.</li>\r\n	<li>This article in which Lord Ganesha is in the sitting pose with a smiling face is also an ideal piece to gift to your loved ones who would definitely be impressed and happy to receive this.</li>\r\n</ul>\r\n', '<p>Vinegar, Salt and Flour: These versatile home staples can be combined to make a paste to&nbsp;<strong>clean tarnished brass</strong>. Dissolve 1 teaspoon of salt into one-half cup of vinegar, and add flour until the mixture becomes a paste. Rub into the&nbsp;<strong>brass</strong>, leave for about 10 minutes, then rinse with warm water and buff dry.</p>\r\n', 'ganesh-ji', 'BRMC00001', 'Copper and Zinc', 0, 1, 2900, 'Y', 'per', 20, 2320, 'N', 'Y', 1576232500, 1577082934, '', '', ''),
